import React from "react";
import HomeIcon from "@mui/icons-material/Home";
import DirectionsBusIcon from "@mui/icons-material/DirectionsBus";
import LockOpenIcon from "@mui/icons-material/LockOpen";
import CreditCardIcon from "@mui/icons-material/CreditCard";

const Navbar: React.FC<{ setCurrentPage: (page: string) => void }> = ({ setCurrentPage }) => {
  return (
    <nav className="navbar">
      <button onClick={() => setCurrentPage("home")}>
        <HomeIcon /> Trang chủ
      </button>
      <button onClick={() => setCurrentPage("busTicket")}>
        <DirectionsBusIcon /> Vé xe bus
      </button>
      <button onClick={() => setCurrentPage("auth")}>
        <LockOpenIcon /> Đăng Nhập
      </button>
      <button onClick={() => setCurrentPage("payment")}>
        <CreditCardIcon /> Thanh toán
      </button>
    </nav>
  );
};

export default Navbar;
